import React, { useState, useMemo } from "react"

import Directory from "../../components/directory/directory.component"

import { HomePageContainer } from './homepage.styles'

const Homepage = ()=>{

	const [aValue, setAValue] = useState(0)
	const [aValue2, setAValue2] = useState(0)

	const doSomethingComplicated = useMemo(() => {
		console.log('lots of complicated stuff here');
		return aValue + 1
	},[aValue])

	return(
		<HomePageContainer>
			<Directory/>
			<button onClick={()=>setAValue(aValue + 1)}>Increase</button>
			<button onClick={()=>setAValue2(aValue2 + 1)}>Increase</button>
				{ doSomethingComplicated() }
				{ aValue2 }
		</HomePageContainer>
	)
}

export default Homepage
